import { RATES_FETCH } from "./types";

const initialState = {
    fetchedRates: ['USD','EUR','RUB'],
}

export const fetchReducer = (state = initialState, action) => {
    switch (action.type) {
        case RATES_FETCH:
            return {
                ...state, fetchedRates: payload
            }
        default: return state;
    }
}
